class CheckUniCodeDetailsModelClass {  final Report report;  CheckUniCodeDetailsModelClass({required this.report});  factory CheckUniCodeDetailsModelClass.fromJson(Map<String, dynamic> json) {    return CheckUniCodeDetailsModelClass(      report: Report.fromJson(json['report']),    );  }}class Report {  final String status;  Report({required this.status});  factory Report.fromJson(Map<String, dynamic> json) {    return Report(      status: json['status'] as String,    );  }}